To implement a CSV parser in Node.js with TypeScript, we will create a module that reads a CSV file, validates its format, and produces structured rows. This implementation will handle edge cases such as empty files and malformed CSV data. Below is the complete implementation:

### CSV Parser Module

#### Step 1: Define the Interface

First, we define the interface for the structured rows that the CSV parser will output.

```typescript
interface CSVRow {
  [key: string]: string | number | boolean | null;
}
```

#### Step 2: Implement the CSV Parser

We will create a CSV parser function that reads a CSV file and returns an array of `CSVRow` objects.

```typescript
import fs from 'fs';
import readline from 'readline';

class CSVParser {
  private delimiter: string;

  constructor(delimiter: string = ',') {
    this.delimiter = delimiter;
  }

  async parse(filePath: string): Promise<CSVRow[]> {
    const fileStream = fs.createReadStream(filePath);

    const rl = readline.createInterface({
      input: fileStream,
      crlfDelay: Infinity
    });

    const rows: CSVRow[] = [];
    let headers: string[] | null = null;

    for await (const line of rl) {
      if (line.trim() === '') continue; // Skip empty lines

      const values = line.split(this.delimiter);

      if (!headers) {
        headers = values;
      } else {
        if (values.length !== headers.length) {
          throw new Error('Malformed CSV: Row length does not match header length');
        }

        const row: CSVRow = {};
        headers.forEach((header, index) => {
          row[header] = this.parseValue(values[index]);
        });

        rows.push(row);
      }
    }

    if (!headers) {
      throw new Error('Empty CSV file');
    }

    return rows;
  }

  private parseValue(value: string): string | number | boolean | null {
    const trimmedValue = value.trim();

    if (trimmedValue === '') return null;
    if (!isNaN(Number(trimmedValue))) return Number(trimmedValue);
    if (trimmedValue.toLowerCase() === 'true') return true;
    if (trimmedValue.toLowerCase() === 'false') return false;

    return trimmedValue;
  }
}

export default CSVParser;
```

#### Step 3: Usage Example

Here's how you can use the `CSVParser` class to parse a CSV file:

```typescript
import CSVParser from './CSVParser';

async function main() {
  const parser = new CSVParser();
  try {
    const rows = await parser.parse('path/to/your.csv');
    console.log(rows);
  } catch (error) {
    console.error('Error parsing CSV:', error.message);
  }
}

main();
```

### Edge Cases Addressed

1. **Empty File**: The parser throws an error if the CSV file is empty.
2. **Malformed CSV**: The parser throws an error if any row's length does not match the header length.
3. **Empty Lines**: The parser skips empty lines in the CSV file.

### Conclusion

This implementation provides a robust CSV parser in Node.js with TypeScript, handling various edge cases and ensuring that the output conforms to the defined interface.

