export interface Strategy {
  name: string;
  process(data: any[]): any;
}

export class SumStrategy implements Strategy {
  name = "SumStrategy";

  process(data: any[]): any {
    const sum = data.reduce((acc, curr) => acc + (parseFloat(curr.value) || 0), 0);
    return { sum };
  }
}

export class AverageStrategy implements Strategy {
  name = "AverageStrategy";

  process(data: any[]): any {
    const validData = data.map(d => parseFloat(d.value)).filter(v => !isNaN(v));
    const sum = validData.reduce((acc, curr) => acc + curr, 0);
    const average = validData.length ? sum / validData.length : 0;
    return { average };
  }
}
```

