import { parseCSV } from './csvParser';
import { SumStrategy, AverageStrategy, Strategy } from './strategy';

async function main() {
  const filePath = 'data.csv'; // Path to your CSV file
  let data: any[];

  try {
    data = await parseCSV(filePath);
  } catch (error) {
    console.error("Error reading CSV file:", error);
    return;
  }

  if (data.length === 0) {
    console.log("Empty CSV file.");
    return;
  }

  const strategies: Strategy[] = [new SumStrategy(), new AverageStrategy()];

  const results = strategies.map(strategy => {
    return {
      strategy: strategy.name,
      result: strategy.process(data)
    };
  });

  console.log(JSON.stringify(results, null, 2));
}

main();
```

