# Data Aggregation Tool

This tool parses a CSV file, performs data aggregation, and outputs a JSON report.

## Usage

1. Ensure you have Node.js installed.
2. Install dependencies:
   ```bash
   npm install
   ```
3. Run the CLI with a CSV file:
   ```bash
   npm start -- path/to/your/file.csv
   ```

## Input CSV Format

The CSV file should have the following columns:
- `id`: A unique identifier for each entry.
- `value`: A numeric value to be aggregated.

## Output JSON Schema

The output JSON will have the following structure:
```json
{
  "summary": "Data aggregation report",
  "aggregations": {
    "total": 100,
    "average": 10
  }
}
```

## Example

Example CSV content:
```csv
id,value
1,10
2,20
3,30
```

Example output:
```json
{
  "summary": "Data aggregation report",
  "aggregations": {
    "total": 60,
    "average": 20
  }
}
```
```

